import React, { useState } from "react";
import { todosLosPaises, ordenadoAZ } from "../redux/accion";
import { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { NavLink } from "react-router-dom";
import Card from "./Card";
export default function Paises() {
  const dispatch = useDispatch();
  const paise = useSelector((state) => state.countries);
  useEffect(() => {
    console.log("useEffect");
    dispatch(todosLosPaises());
  }, []);

  const [actualiza, setActualiza] = useState();

  const handleOrden = (e) => {
    dispatch(ordenadoAZ(e.target.value));
    setActualiza(e.target.value);
  };

  return (
    <div>
      <div></div>

      <div>
        <select name="" onChange={(e) => handleOrden(e)}>
          <option value="A-Z">A-Z</option>
          <option value="Z-A">Z-A</option>
        </select>
      </div>

      <div>
        {paise.map((e) => {
          return (
            <NavLink to={`countries/${e.id}`}>
              {" "}
              <Card name={e.name} img={e.img} continente={e.continente} />{" "}
            </NavLink>
          );
        })}
      </div>
    </div>
  );
}
